import React from 'react';
import ReactDOM from 'react-dom';
const name = 'Pooja';
const date = new Date().ToLocaleDateString();
const time = new Date().ToLocaleTimeString();
ReactDOM.render(
  <>
<h1>My name is {name} </h1>
 <p>Date : {date}</p>
 <p>Time : {time}</p>
</>,
document.getElementById('root')

);
